        alignItems: 'center',
        padding: '20px',
    }

    return (
        <div style={ footer }>
            <div>
                <img src="/images/cbsiLogo.png" alt="CBSI Logo" width="200vw"/>
            </div>

            <p>Copyright Â© 2020 CBSI. All rights reserved.</p>
        </div>
    );
}

export default Footer;
